            <h3>Instructors</h3>
            <ul>
                <li>Carol - Shearose@mindspring.com  </li>
                <li>Abby - ald2424@hotmail.com   </li>
                <li>Arleen - Arleen321@yahoo.com</li>
            </ul>
        </div>
    )
}

export default Lessons;
